अनचाहे ऑडियो विज्ञापनों / गानों को अचानक बजने से रोकने का एक तरीका चाहते हैं जब आप दूसरे ब्राउज़र टैब में हों?

ऑडियो विज्ञापनों को स्वचालित रूप से म्यूट करने में मदद करने का यह एक त्वरित और सरल तरीका है। {{}

बस विस्तार स्थापित करें
यदि टैब चयनित नहीं है तो हमारा सॉफ्टवेयर अन्य खुले टैब से ध्वनि को अवरुद्ध करेगा। {{}
यदि आप किसी भी ध्वनि को बजने से रोकना चाहते हैं, तो बस "साइलेंट मोड" चुनें और हमारा एक्सटेंशन सभी खुले टैब को म्यूट कर देगा। {२}

इस एक्सटेंशन को बंद करने और अन्य टैब से ऑडियो को चलाने की अनुमति देने के लिए, आपको एक्सटेंशन आइकन पर क्लिक करना होगा और "ऑफ़" बटन चुनना होगा।

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस Chrome एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। Google Chrome के लिए ऑटो म्यूट का स्वामित्व नहीं है, इसके पास लाइसेंस नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
